import React from "react";
import { CSSTransition } from "react-transition-group";
import "./Home.styles.css";


function Home() {
  const [inProp, setInProp] = React.useState(false);

  React.useEffect(() => {
    setInProp(true);
  }, []);

  return (
    <div className="home main-content">
      <CSSTransition
        in={inProp}
        timeout={300} 
        classNames="fade" 
        unmountOnExit
      >
        <h1>Welcome to my website</h1>
      </CSSTransition>
    </div>
  );
}

export default Home;
